import ExpenseItem from './ExpenseItem';
import './Expenses.css';

function Expenses(props) {
    return (
    <div className="expenses">
        <ExpenseItem item={props[0]}></ExpenseItem>
        <ExpenseItem item={props[1]}></ExpenseItem>
        <ExpenseItem item={props[2]}></ExpenseItem>
        <ExpenseItem item={props[3]}></ExpenseItem>
    </div>
    );
}

export default Expenses;
